This question already has answers here:Why do I get "NameError: name '...' is not defined" (or a SyntaxError, or a number instead of a string) when using the input function (in Python 2.x)?(15 answers)Closed9 years ago.Ok, so I'm writing a grade checking code in python and my code is:unit3Done = str(input("Have you done your Unit 3 Controlled Assessment? (Type y or n): ")).lower()
if unit3Done == "y":
    pass
elif unit3Done == "n":
    print "Sorry. You must have done at least one unit to calculate what you need for an A*"
else:
    print "Sorry. That's not a valid answer."When I run it through my python compiler and I choose"n", I get an error saying:"NameError: name 'n' is not defined"and when I choose"y"I get anotherNameErrorwith'y'being the problem, but when I do something else, the code runs as normal.Any help is greatly appreciated,Thank you.

Your main problem is this line:dicta = aDictYou think you're making a copy of the dictionary, but actually you still have just one dictionary, so operations on dicta also change aDict (and so, you remove values from adict, they also get removed from aDict, and so you get your KeyError).One solution would bedicta = aDict.copy()(You should also give your variables clearer names to make it more obvious to yourself what you're doing)(edit) Also, an easier way of doing what you're doing:def iter_unique_keys(d):
    values = list(d.values())
    for key, value in d.iteritems():
        if values.count(value) == 1:
            yield key

print list(iter_unique_keys({1: 1, 2: 1, 3: 3}))

